import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  console.log(props);
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.pic} alt="avatar_img" />
      <p>{props.ph}</p>
      <p>{props.mail}</p>
    </div>
  );
}

ReactDOM.render(
  <div>
    <h1>My Contacts</h1>
    <Card
      name="Beyonce"
      pic="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
      ph="+123 456 789"
      mail="b@beyonce.com"
    />
    <Card
      name="Ariana Grande"
      pic="data:image/jpeg;base64,"
      ph="+123 456 789"
      mail="b@beyonce.com"
    />
    <Card
      name="Abel Tesfaye"
      pic="data:image/jpeg;base64,"
      ph="+123 456 789"
      mail="b@beyonce.com"
    />
  </div>,
  document.getElementById("root")
);
